let text = " GG ";

function getContestData(){
  fetch('https://kontests.net/api/v1/all')
  .then((res) => res.json())
  .then((data) => {
    console.log(data[0].name);

    for(let info in data)
    {
      text += info + " ";
    }
  })
}

function App() {
  console.log(text);
  getContestData();
  console.log(text);
  return text;
}

export default App;
